import React from 'react'
import CartFood from './CartFood'

const Cart = ({data}) => {
    const { Idly,
            Dosa,
            Chapathi,
            Pongal,
            Puri,
            Aapam} = data;
            console.log(Idly, Dosa, Chapathi, Pongal, Puri, Aapam)
    return (
        <div>
            {
                Idly > 0 ? <CartFood title="Idly" value={Idly}/>: null
            }
            {
                Dosa > 0 ? <CartFood title="Dosa" value={Dosa}/>: null
            }
            {
                Chapathi > 0 ? <CartFood title="Chapathi" value={Chapathi}/>: null
            }
            {
                Pongal > 0 ? <CartFood title="Pongal" value={Pongal}/>: null
            }
            {
                Puri > 0 ? <CartFood title="Puri" value={Puri}/>: null
            }
            {
                Aapam > 0 ? <CartFood title="Aapam" value={Aapam}/>: null
            }
        </div>
    )
}

export default Cart;
